import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The products are loaded dynamically after clicking a category.
    // Let's click the first category card to show the products.
    const categoryCardSelector = '.category-card:has-text("Electronics")';
    await page.waitForSelector(categoryCardSelector, { timeout: 5000 });
    await page.locator(categoryCardSelector).click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_loaded.png'));

    // Now that products are visible, find the first "Add to Cart" button and click it.
    const addToCartSelector = '.product-card .add-to-cart';
    await page.waitForSelector(addToCartSelector, { state: 'visible', timeout: 5000 });

    // Using locator with .first() to ensure we target the first available product.
    await page.locator(addToCartSelector).first().click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_item_added.png'));

    // Verify the action by checking localStorage, as the JS code updates it.
    const cartData = await page.evaluate(() => {
      return JSON.parse(localStorage.getItem('amazonCart'));
    });

    if (!cartData || cartData.length === 0) {
      throw new Error('Cart data not found in localStorage after adding item.');
    }

    return {
      success: true,
      action: "Added the first product to the cart after selecting a category.",
      extractedData: {
        cartItemCount: cartData.length,
        firstItem: cartData[0]
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a final screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
    screenshots.push(path.join(screenshotsDir, 'error_screenshot.png'));

    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
